Job_Description:
The Senior Machine Learning Engineer is responsible for leading design, development, and implementation of Solutions and Business Deliverables of AI/ML capabilities across the entire business and technical enterprise. These Solutions are designed to meet the needs of the ACORD Solutions Group Clientele. The Architect will be leading large and complex initiatives with responsibility to define implementation roadmaps, system architecture as well as execution.
Senior Machine Learning Engineer Position Responsibilities
Ensure that consistent design principles and best practices for developing AI/ML capabilities on the cloud are utilized across the enterprise;
Partner closely with resident data scientist(s), AI/ML developers, product engineering and other business leaders to influence product and program decisions with facts and data;
